import React from 'react';

function GenreBreakdown({ genres }) {
  return (
    <div className="genre-breakdown">
      <h2>Your Genre Breakdown</h2>
      <ul>
        {Object.entries(genres).map(([genre, percentage]) => (
          <li key={genre}>{genre}: {percentage}%</li>
        ))}
      </ul>
    </div>
  );
}

export default GenreBreakdown;
